import * as React from 'react';
import { HostSection } from '../../host/wrapper/HostSection';

export const HomesQuestions: React.FC<{}> = () => {
  return (
    <HostSection title='Frequently asked questions'>
      //{' '}
      <div className='lg:flex'>
        //{' '}
        <div
          style={{ fontFamily: 'airbnb-book' }}
          className='md:w-full lg:w-1/2 text-green-850 md:text-lg flex lg:justify-end'>
          <div className='lg:w-95p'>
            <div className='my-10'>
              <a href=''>Who can be an Airbnb host?</a>
            </div>
            <div className='my-10'>
              <a href=''>What is required of guests before booking?</a>
            </div>
            <div className='md:mt-10 lg:my-10'>
              <a href=''>How much does it cost to list my space?</a>
            </div>
          </div>
        </div>
        <div
          style={{ fontFamily: 'airbnb-book' }}
          className='md:w-full lg:w-1/2 text-green-850 md:text-lg flex lg:justify-end'>
          <div className='lg:w-95p'>
            <div className='mt-10 lg:my-10'>
              <a href=''>What protection do I have against property damage?</a>
            </div>
            <div className='my-10'>
              <a href=''>How should I choose my listing's price?</a>
            </div>
            <div className='my-10'>
              <a href=''>How can Airbnb help me with setting prices?</a>
            </div>
          </div>
        </div>
      </div>
    </HostSection>
    // <div className='w-full px-6 md:px-0 md:max-w-2xl lg:max-w-5xl mx-auto py-8'>
    //   <div className='flex md:justify-center'>
    //     <div
    //       style={{ width: 70, height: 2 }}
    //       className='bg-gray-650 rounded-lg'></div>
    //   </div>

    //   <div className='flex md:justify-center md:mb-12 mt-2'>
    //     <h3
    //       style={{ fontFamily: 'airbnb-bold' }}
    //       className='text-gray-750 text-4xl lg:text-6xl tracking-tight'>
    //       Frequently asked questions
    //     </h3>
    //   </div>

    // </div>
  );
};
